(18, 1537, 494, 'Board, boardmarker, text book', 'different aspects of HPE and interrelation between them', 'student teacher discussion, group discussion', 'After finishing this lesson students will be able to: 1) state various aspects of HPE, 2) describe the aspects 3) interrelate one aspects with other aspects', '2018-05-01,2018-05-07', 'classworks, homeworks, oral test', '1) Write the different aspects of HPE and explain them. 2) HPE is an interdisciplinary subject. Explain. 3) Explain the interrelationship between different aspects of HPE with each other.', 'VAP', '', '2018-05-22 13:05:33'),
(19, 1537, 505, 'Board, boardmarker, text book', 'Fertility, Mortality and Migration, Consequences of Rapid Population Growth, Population management', 'student teacher discussion, group discussion', 'After finishing this lesson students will be able to: 1) define demography, demographic components, processes and measures 2) Calculate the demographic measures from given data by using formula 3) Explain the consequences of RPG 4) Describe the population', '2018-05-20,2018-05-25', 'classworks, homeworks, oral test', 'Do all the exercises from the text book', 'VAP', '', '2018-05-22 13:17:04'),
(20, 1535, 588, 'Board, boardmarker, text book', 'cgs system, fps system, mks system, SI system, fundamental and derived quantities and units', 'student teacher discussion, group discussion', 'After finishing this lesson students will be able to: 1) tell the importance of measurement 2) define fundamental units and derived units 3) identify the units of mass, time and weight in different measurement systems 4) solve numerical problems related t', '2018-05-01,2018-05-08', 'classworks, homeworks, oral test', 'Do all the exercises from the text book', 'VAP', '', '2018-05-22 13:47:25'),
(21, 1535, 589, 'Board, boardmarker, text book', 'velocity, speed, vector, scalar, uniform velocity, relative velocity, acceleration', 'student teacher discussion, group discussion', 'After finishing this lesson students will be able to: 1) describe average velocity and relative velocity, 2) introduce acceleration and retardation 3) write the equations related to velocity and acceleration and use them 4) Solve simple numerical problems', '2018-05-13,2018-05-19', 'classworks, homeworks, oral test', 'Do all the exercises from the text book', 'VAP', '', '2018-05-22 13:52:06'),
(22, 1535, 598, 'Board, boardmarker, text book', 'Element, compound, atom, molecule, molecular formula, atomic structure, protons, electrons, neutrons, valency, periodic table, atomic mass, chemical equation', 'student teacher discussion, group discussion', 'After finishing this lesson students will be able to: 1) write briefly about structure of atom and its components 2) define atomic number, atomic mass, molecular weight 3) introduce Periodic table 4) write the molecular formula of compounds 5) determine t', '2018-05-20,2018-05-28', 'classworks, homeworks, oral test', 'Do all the exercises from the text book', 'VAP', '', '2018-05-22 14:01:04'),
(23, 1536, 672, 'Board, boardmarker, text book', 'Element, compound, atom, molecule, molecular formula, atomic structure, protons, electrons, neutrons, valency, periodic table, atomic mass, chemical equation', 'student teacher discussion, group discussion', 'After finishing this lesson students will be able to: 1) write briefly about structure of atom and its components 2) define atomic number, atomic mass, molecular weight 3) introduce Periodic table 4) write the molecular formula of compounds 5) determine t', '2018-05-23,2018-05-31', 'classworks, homeworks, oral test', 'Do all the exercises from the text book', 'VAP', '', '2018-05-22 14:20:10'),
(24, 1422, 449, 'book ,marker,board', 'reuirements for business,skills', 'group interaction,rasing questions', 'will be able to understand how business is operated,trading skill,challenges in business,ways to promote trade', '2018-05-24,2018-05-31', 'raising question related to the topics covered in class', 'research work related to problems of business sector in nepal', 'VAP', '', '2018-05-25 03:42:58'),
