(1, 1, 'Lhosar Holiday', 'It is notify that the school remains closed on Wednesday, 25 February 2009 on the occasion of Lhosar. The classes will resume on Thursday, 26 February 2009.', 'It is notify that the school remains closed on Wednesday, 25 February 2009 on the occasion of Lhosar. The classes will resume on Thursday, 26 February 2009.', 1, '2009-02-22 11:42:19', '2009-02-23 00:00:00', '2009-02-28 00:00:00', NULL),
(2, 4, 'Rules and Regulations', 'All my bags are packed I''m ready to go<br/>I''m standing here outside your door<br/>I hate to wake you up to say goodbye<br/>But the dawn is breaking it''s early morn<br/>The taxi''s waiting he''s blowing his horn<br/>Already I''m so lonesome I could die<br/><', 'All my bags are packed I''m ready to go<br/>I''m standing here outside your door<br/>I hate to wake you up to say goodbye<br/>But the dawn is breaking it''s early morn<br/>The taxi''s waiting he''s blowing his horn<br/>Already I''m so lonesome I could die<br/><br/>So kiss me and smile for me<br/>Tell me that you''d wait for me<br/>Hold me like you''ll never let me go<br/>qos I''m leaving on a jet plane<br/>donno when I''ll be back again<br/>oh babe...I hate to go<br/><br/>There''s so many time I let you down<br/>so many times I play around<br/>I''ll tell you now they don''t mean a thing<br/>Every place I go I''ll think of you<br/>Every song I sing I''ll sing for you<br/>When I come back I''ll bring your wedding ring<br/><br/>So kiss me and smile for me<br/>Tell me that you''d wait for me<br/>Hold me like you''ll never let me go<br/>qos I''m leaving on a jet plane<br/>donno when I''ll be back again<br/>oh babe...I hate to go<br/><br/>Now the time''s come to leave you<br/>One more time let me kiss you<br/>Close your eyes, I''ll be on my way<br/>Dream about the days to come<br/>When I won''t have to live alone<br/>About the times I won''t have to say<br/><br/>Oh kiss me and smile for me<br/>Tell me that you''d wait for me<br/>Hold me like you''ll never let me go<br/>qos I''m leaving on a jet plane<br/>donno when I''ll be back again<br/>oh babe...I hate to go<br/><br/>I''m leaving on a jet plane<br/>donno when I''ll be back again<br/>oh babe...I hate to go', 1, '2009-05-07 16:46:58', '2009-02-27 00:00:00', NULL, NULL),
(4, 2, 'Peace Rally', 'This is to notify all students that our school is participating in a peace rally organized by Child Protection Group Nepal on Friday 27 February 2009. All the interested students are requested to arrive in the school premises by 10 am in the morning of th', 'This is to notify all students that our school is participating in a peace rally organized by Child Protection Group Nepal on Friday 27 February 2009. All the interested students are requested to arrive in the school premises by 10 am in the morning of the day.', 1, '2009-02-26 15:22:55', '2009-02-26 00:00:00', NULL, NULL),
(5, 1, 'First Internal Examination PostPoned', 'This is to notify all the teachers and students that the first internal examination scheduled on March 22  has been preponded to be scheduled on March 12 due to some unforeseen threat.', 'This is to notify all the teachers and students that the first internal examination scheduled on March 22  has been preponded to be scheduled on March 12 due to some unforeseen threat.', 1, '2009-03-15 15:13:32', '2009-03-02 00:00:00', '2009-03-03 00:00:00', NULL),
(6, 5, 'LUNCH DUITY', 'Press Q+E together Ur player will automatically move towards the ball without direction key during DEF and knock it from the defender''s control.<br/>Prees C to call defender during goalkick/ to call 2nd player during freekick/ to take quick freekick.<br/>', 'Press Q+E together Ur player will automatically move towards the ball without direction key during DEF and knock it from the defender''s control.<br/>Prees C to call defender during goalkick/ to call 2nd player during freekick/ to take quick freekick.<br/>Press S+D to shoot the ball along the ground during FREEKICK<br/>Press D + Up/Down/Left/Right or combine like D + Up n Down or so on to get swing during FREEKICK n CORNERS<br/>Press C+D during FREEKICK the 2nd player will shoot the ball instantly<br/>Press Z+D during FREEKICK the 1st player will roll over the ball to confuse the defense and the 2nd player will shoot it.<br/>Press C+Left/Right to move ur 2nd player Left/Right during FREEKICK<br/>Press C+Q to knock the ball to the 1st player by the 2nd player during FREEKICK<br/>Press S+D during SHOOTING infront of GOAL u will see the MODIFIED DIFFERENCE', 1, '2009-05-07 16:46:41', '2009-03-26 00:00:00', NULL, NULL);
