INSERT INTO `tutorial` (`tutorial_id`, `tutorial_name`, `subject_id`, `posted_by`, `tutorial_content`, `posted_on`, `modified_on`, `published_on`) VALUES
(1, 'Intonations', 93, 2, '<p>This is a tutorial on intonation. This is the edit of the tutorial. More edit. Even more edit.</p>', '2009-02-20 13:06:53', '2009-02-20 15:23:24', NULL),
(3, 'Vocabulary', 93, 2, '<p>abase</p>\r\n<p>abate</p>\r\n<p>abash</p>\r\n<p>abrasion</p>\r\n<p>abjure</p>\r\n<p>&nbsp;</p>\r\n<p>debase</p>\r\n<p>debauch</p>', '2009-02-20 13:31:52', '2009-02-20 15:26:04', '2009-02-12 00:00:00'),
(4, 'Sophie''s World', 93, 2, '<p><span style="border-collapse: separate; color: rgb(0, 0, 0); font-family: -webkit-sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px;" class="Apple-style-span">\r\n<h1 style="border-bottom: 1px solid rgb(170, 170, 170); margin: 0px 0px 0.1em; color: black; background-image: none; font-weight: normal; padding-top: 0.5em; font-size: 188%; line-height: 1.2em; padding-bottom: 0px;" class="firstHeading" id="firstHeading">Sophie''s World</h1>\r\n<div style="position: relative;" id="bodyContent">\r\n<h3 style="margin: 0px 0px 0.3em; color: black; background-image: none; padding-top: 0.5em; padding-bottom: 0.17em; border-bottom-style: none; display: inline; font-size: 92%; font-weight: normal;" id="siteSub">From Wikipedia, the free encyclopedia</h3>\r\n<table cellspacing="5" style="border: 1px solid rgb(170, 170, 170); margin: 0.5em 0px 0.5em 1em; padding: 0.2em; text-align: left; line-height: 1.5em; width: 20em; font-size: 100%; float: right; clear: right; background-color: rgb(249, 249, 249); color: black;" class="infobox">\r\n    <tbody>\r\n        <tr>\r\n            <td style="background: inherit inherit inherit inherit inherit; text-align: center; font-size: 125%; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; font-weight: bold; font-style: italic; vertical-align: top;" colspan="2">Sophie''s World<span class="Apple-converted-space">&nbsp;</span><span title="ctx_ver=Z39.88-2004&amp;rft_val_fmt=info%3Aofi%2Ffmt%3Akev%3Amtx%3Abook&amp;rft.genre=book&amp;rft.btitle=Sophie%27s+World&amp;rft.author=%5B%5BJostein+Gaarder%5D%5D&amp;rft.date=1991&amp;rft.pub=%5B%5BH.+Aschehoug+%26+Company%5D%5D&amp;rft.pages=508+pp" class="Z3988">&nbsp;</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style="text-align: center; vertical-align: top;" colspan="2"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Book cover" class="image" href="/wiki/File:SophiesWorld.png"><img width="200" height="339" border="0" style="border-style: none; vertical-align: middle;" src="http://upload.wikimedia.org/wikipedia/en/thumb/5/53/SophiesWorld.png/200px-SophiesWorld.png" alt="Book cover" /></a></td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;">Author</th>\r\n            <td style="vertical-align: top;"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Jostein Gaarder" href="/wiki/Jostein_Gaarder">Jostein Gaarder</a></td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;">Original title</th>\r\n            <td style="vertical-align: top;"><i>Sofies verden</i></td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;">Country</th>\r\n            <td style="vertical-align: top;"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Norway" href="/wiki/Norway">Norway</a></td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;">Language</th>\r\n            <td style="vertical-align: top;"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Norwegian language" href="/wiki/Norwegian_language">Norwegian</a></td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;">Genre(s)</th>\r\n            <td style="vertical-align: top;"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Philosophical novel" href="/wiki/Philosophical_novel">Philosophical novel</a></td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" class="mw-redirect" title="Publisher" href="/wiki/Publisher">Publisher</a></th>\r\n            <td style="vertical-align: top;"><a style="text-decoration: none; background-image: none; color: rgb(204, 34, 0);" title="H. Aschehoug &amp; Company (page does not exist)" class="new" href="/w/index.php?title=H._Aschehoug_%26_Company&amp;action=edit&amp;redlink=1">H. Aschehoug &amp; Company</a></td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;">Publication date</th>\r\n            <td style="vertical-align: top;">1991</td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;">Published in<br />\r\n            English</th>\r\n            <td style="vertical-align: top;">1995</td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;">Media type</th>\r\n            <td style="vertical-align: top;">print (<a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Hardcover" href="/wiki/Hardcover">hardback</a><span class="Apple-converted-space">&nbsp;</span>&amp;<a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Paperback" href="/wiki/Paperback">paperback</a>)</td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;">Pages</th>\r\n            <td style="vertical-align: top;">508 pp</td>\r\n        </tr>\r\n        <tr>\r\n            <th style="background: inherit inherit inherit inherit inherit; -moz-background-clip: inherit; -moz-background-origin: inherit; -moz-background-inline-policy: inherit; white-space: nowrap; vertical-align: top;"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="International Standard Book Number" href="/wiki/International_Standard_Book_Number">ISBN</a></th>\r\n            <td style="vertical-align: top;"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Special:BookSources/82-03-16841-8" href="/wiki/Special:BookSources/82-03-16841-8">82-03-16841-8</a></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 1.5em;"><i><b>Sophie''s World</b></i><span class="Apple-converted-space">&nbsp;</span>(<i><b>Sofies verden</b></i><span class="Apple-converted-space">&nbsp;</span>in the original<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Norwegian language" href="/wiki/Norwegian_language">Norwegian</a>) is a<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Novel" href="/wiki/Novel">novel</a><span class="Apple-converted-space">&nbsp;</span>by<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Jostein Gaarder" href="/wiki/Jostein_Gaarder">Jostein Gaarder</a>, published in 1991. It was originally written in Norwegian, but has since been translated into<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="English language" href="/wiki/English_language">English</a><span class="Apple-converted-space">&nbsp;</span>(1995) and many other languages.</p>\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 1.5em;">Mostly consisting of<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Dialogue" href="/wiki/Dialogue">dialogues</a><span class="Apple-converted-space">&nbsp;</span>between Sophie Amundsen and a mysterious man named Alberto Knox, interwoven with an increasingly bizarre and mysterious plot,<span class="Apple-converted-space">&nbsp;</span><i>Sophie''s World</i><span class="Apple-converted-space">&nbsp;</span>acts as both a novel and a basic guide to<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Philosophy" href="/wiki/Philosophy">philosophy</a>.</p>\r\n<table style="border: 1px solid rgb(170, 170, 170); padding: 5px; color: black; background-color: rgb(249, 249, 249); font-size: 95%; margin-top: 0.5em;" summary="Contents" class="toc" id="toc">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <div style="text-align: center;" id="toctitle">\r\n            <h2 style="border-style: none; margin: 0px 0px 0.6em; padding: 0px; color: black; background-image: none; display: inline; font-size: 100%; font-weight: bold;">Contents</h2>\r\n            <span class="Apple-converted-space">&nbsp;</span><span style="font-size: 94%;" class="toctoggle">[<a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" href="javascript:toggleToc()" class="internal" id="togglelink">hide</a>]</span></div>\r\n            <ul style="margin: 0.3em 0px 0px; padding: 0px; line-height: 1.5em; list-style-type: none; list-style-image: none; text-align: left;">\r\n                <li style="margin-bottom: 0.1em;" class="toclevel-1"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" href="#Plot_summary"><span class="tocnumber">1</span><span class="Apple-converted-space">&nbsp;</span><span class="toctext">Plot summary</span></a></li>\r\n                <li style="margin-bottom: 0.1em;" class="toclevel-1"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" href="#Adaptation"><span class="tocnumber">2</span><span class="Apple-converted-space">&nbsp;</span><span class="toctext">Adaptation</span></a></li>\r\n                <li style="margin-bottom: 0.1em;" class="toclevel-1"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" href="#See_also"><span class="tocnumber">3</span><span class="Apple-converted-space">&nbsp;</span><span class="toctext">See also</span></a></li>\r\n                <li style="margin-bottom: 0.1em;" class="toclevel-1"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" href="#References"><span class="tocnumber">4</span><span class="Apple-converted-space">&nbsp;</span><span class="toctext">References</span></a></li>\r\n                <li style="margin-bottom: 0.1em;" class="toclevel-1"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" href="#External_links"><span class="tocnumber">5</span><span class="Apple-converted-space">&nbsp;</span><span class="toctext">External links</span></a></li>\r\n            </ul>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 1.5em;"><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" id="Plot_summary" name="Plot_summary"></a></p>\r\n<h2 style="border-bottom: 1px solid rgb(170, 170, 170); margin: 0px 0px 0.6em; color: black; background-image: none; font-weight: normal; padding-top: 0.5em; padding-bottom: 0.17em; font-size: 150%;"><span style="float: right; margin-left: 5px; font-size: 67%;" class="editsection">[<a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Edit section: Plot summary" href="/w/index.php?title=Sophie%27s_World&amp;action=edit&amp;section=1">edit</a>]</span><span class="mw-headline">Plot summary</span></h2>\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 1.5em;">Sophie Amundsen (Sofie Amundsen in the Norwegian version) is a fourteen year old girl living in<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Norway" href="/wiki/Norway">Norway</a><span class="Apple-converted-space">&nbsp;</span>in 1990. She lives with her cat Sherekan, her goldfish, a tortoise, two<a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Budgerigar" href="/wiki/Budgerigar">budgerigars</a><span class="Apple-converted-space">&nbsp;</span>and her mother. Her father is a captain of an<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Oil tanker" href="/wiki/Oil_tanker">oil tanker</a>, and is away for most of the year. He does not appear in the book.</p>\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 1.5em;">Sophie''s life is rattled as the book begins, when she receives two anonymous messages in her mailbox (<i>Who are you? Where does the world come from?</i>), as well as a<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" class="mw-redirect" title="Post card" href="/wiki/Post_card">post card</a><span class="Apple-converted-space">&nbsp;</span>addressed to ''Hilde M&oslash;ller Knag,<span class="Apple-converted-space">&nbsp;</span><a style="padding: 0px; text-decoration: none; color: rgb(51, 102, 187); background-image: none;" title="wikt:care of" class="extiw" href="http://en.wiktionary.org/wiki/care_of">c/o</a><span class="Apple-converted-space">&nbsp;</span>Sophie Amundsen''. Shortly afterwards she receives a packet of papers, part of a<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" class="mw-redirect" title="Correspondence course" href="/wiki/Correspondence_course">correspondence course</a><span class="Apple-converted-space">&nbsp;</span>in philosophy.</p>\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 1.5em;">With these mysterious communications, Sophie becomes the student of a fifty-year-old philosopher, Alberto Knox. He starts out as totally anonymous, but as the story unfolds he reveals more and more about himself. The papers and the packet both turn out to be from him, although the post card is not; it is addressed from someone called Albert Knag, who is a major in a<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Department of Peacekeeping Operations" href="/wiki/Department_of_Peacekeeping_Operations">United Nations peacekeeping unit</a><span class="Apple-converted-space">&nbsp;</span>stationed in<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Lebanon" href="/wiki/Lebanon">Lebanon</a>.</p>\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 1.5em;">Alberto teaches her about the<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="History of philosophy" href="/wiki/History_of_philosophy">history of philosophy</a>. She gets a substantive and understandable review from the<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Pre-Socratic philosophy" href="/wiki/Pre-Socratic_philosophy">Pre-Socratic Greeks</a><span class="Apple-converted-space">&nbsp;</span>through<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Jean-Paul Sartre" href="/wiki/Jean-Paul_Sartre">Jean-Paul Sartre</a>. Along with the philosophy lessons, Sophie and Alberto try to outwit the mysterious Albert Knag, who appears to have God-like powers, which Alberto finds quite troubling.</p>\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 1.5em;">Sophie learns about<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" class="mw-redirect" title="Medieval" href="/wiki/Medieval">medieval</a><span class="Apple-converted-space">&nbsp;</span>philosophy while being lectured by Alberto, dressed as a<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Monk" href="/wiki/Monk">monk</a>, in an ancient church, and she learns about Jean-Paul Sartre and<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Simone de Beauvoir" href="/wiki/Simone_de_Beauvoir">Simone de Beauvoir</a><span class="Apple-converted-space">&nbsp;</span>in a French caf&eacute;. Various philosophical questions and methods of reasoning are put before Sophie, as she attempts to work them out on her own. Many of Knox''s philosophic packets to her are preluded by more short questions, such as &quot;Why is<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Lego" href="/wiki/Lego">Lego</a><span class="Apple-converted-space">&nbsp;</span>the most ingenious toy in the world?&quot;.</p>\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 1.5em;">Alberto takes Sophie from<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Hellenistic civilization" href="/wiki/Hellenistic_civilization">Hellenism</a><span class="Apple-converted-space">&nbsp;</span>to the rise of<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Christianity" href="/wiki/Christianity">Christianity</a><span class="Apple-converted-space">&nbsp;</span>and its interaction with<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Ancient Greece" href="/wiki/Ancient_Greece">Greek</a><span class="Apple-converted-space">&nbsp;</span>thought and on into the<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Middle Ages" href="/wiki/Middle_Ages">Middle Ages</a>. Over the course of the book, he covers the<a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Renaissance" href="/wiki/Renaissance">Renaissance</a>,<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Baroque" href="/wiki/Baroque">Baroque</a>,<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Age of Enlightenment" href="/wiki/Age_of_Enlightenment">Enlightenment</a><span class="Apple-converted-space">&nbsp;</span>and<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Romanticism" href="/wiki/Romanticism">Romantic</a><span class="Apple-converted-space">&nbsp;</span>periods, and the philosophies that stemmed from them.</p>\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 1.5em;">Mixed in with the philosophy lessons is a plot rather more akin to normal<span class="Apple-converted-space">&nbsp;</span><a style="text-decoration: none; color: rgb(0, 43, 184); background-image: none;" title="Young-adult fiction" href="/wiki/Young-adult_fiction">teenage novels</a>, in which Sophie interacts with her mother and her friends. This is not the focus of the story, however; it simply serves to move the plot along. As Albert Knag continues to meddle with Sophie''s life, Alberto helps her fight back by teaching her everything he knows about philosophy. This, he explains, is the only way to understand her world.</p>\r\n</div>\r\n</span></p>', '2009-03-23 11:31:54', NULL, '2009-03-23 11:32:00'),
